The Tokyo 2020 Paralympic Games marked another stellar showing for New Zealand’s Para swimming powerhouse @sophpascoe1. The 28-year-old experienced nearly every kind of emotion at the Games, from sheer disbelief at clinching a silver in the women's 100m breaststroke SB8, to tears of joy after a career first Paralympic bronze in the women's 100m backstroke S9. New Zealand's most successful Paralympian leaves Japan's capital having taken her sporting legacy to next level. She won two golds, one silver and one bronze medal.

